// Navbar.js
import React from 'react';

const Navbar = () => {
  return (
    <div className="navbar p-4 flex justify-between items-center text-center">
      <div className="text-white text-3xl"> </div>
      <div className="flex space-x-4">
      <div className="text-white text-3xl ml-19">BEAUTY SALON</div>
      </div>
      
    </div>
  );
};

export default Navbar;
